from collections import Counter

def reduce_list(lst):
    counter = Counter(lst)
    order = {v: i for (i, v) in enumerate(lst)}
    while len(counter) >= 5:
        least_frequent = sorted(counter.items(), key=lambda x: (x[1], order[x[0]]))[0][0]
        del counter[least_frequent]
    return list(counter.keys())

